import './header.css';
import React from 'react';
import Victoria from './IMG_0897.JPG';


class Gallery extends React.Component {
render() {
    return (
        <div className="gallery">
            <a href={Victoria} data-caption="Image caption">
                <img src={Victoria} alt="First image" />
            </a>
            <a href={Victoria}>
                <img src={Victoria} alt="Second image" />
            </a>

        </div>






    );
  }
}

export default Gallery;
